import React from "react";
import Landing from "./pages/Landing";
import { BrowserRouter, Route, Switch } from "react-router-dom";

import Footer from "./pages/general/Footer";

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact component={Landing} />
      </Switch>
      <Footer />
    </BrowserRouter>
  );
};

export default App;
